import React from 'react';
import { Link } from "react-router-dom";

const List = ({todoCategory}) => {
    return (  
      <div> 
        <React.Fragment>
           {
              todoCategory.map(item => (
            <ul className="list-group" key={item._id}>
              <li className="list-group-item">
                <Link>
                {item.categoryTitle}
                </Link>  
              </li>   
            </ul>
            ))
          }
         
        </React.Fragment>
      </div>
    );
} 

export default List;
